#crea un modelo gru generico en base a los parametros que le pasemos
def crear_modelo_gru(units_, layers, sequence_,):

  modelGRU = Sequential()

  for x in range(layers - 1):
    modelGRU.add(GRU(units= units_, return_sequences= sequence_, input_shape=(X_train.shape[1],1)))
    modelGRU.add(Dropout(0.2))

  modelGRU.add(GRU(units=units_))
  modelGRU.add(Dropout(0.2))

  modelGRU.add(Dense(units=1))

  return modelGRU

#entrena el modelo anterior con parametros pasados por funcion
def entrenar_modelo(modelo, optimizer_, epochs_, batch_size_):

    modelo.compile(optimizer = optimizer_, loss='mean_squared_error', metrics=[tf.keras.metrics.RootMeanSquaredError(), tf.keras.metrics.MeanAbsoluteError(), tf.keras.metrics.MeanSquaredLogarithmicError()])
    
    history = modelo.fit(X_train, y_train, epochs = epochs_, batch_size = batch_size_)
    dic = {
        "mean_squared_error" : history.history["loss"],
        "root_mean_squared_error" : history.history["root_mean_squared_error"],
        "mean_absolute_error" : history.history["mean_absolute_error"],
        "mean_squared_logarithmic_error" : history.history["mean_squared_logarithmic_error"]
    }

    return dic



# obtenemos datos de las metricas
def calcular_metricas(predict_, test):

  diff = predict_ - test

  dic = {
      "MSE" : np.mean(diff**2),
      "MAE" : np.mean(abs(diff)),
      "RMSE" : np.sqrt(np.mean(diff**2))
  }

  return dic


