def generate_X_test():
  data_volume_ = np.vstack((train, test))
  inputs_ = data_volume_[data_volume_.shape[0] - test.shape[0] - window:]
  inputs_ = inputs_.reshape(-1,1)
  inputs_ = sc.transform(inputs_)

  num_2_ = data_volume_.shape[0] - num_shape + window

  X_test_ = []

  for i in range(window, num_2_):
      X_test__ = np.reshape(inputs_[i-window:i, 0], (window, 1))
      X_test_.append(X_test__)
      
  return np.stack(X_test_)

#comenzamos con la prediccion del modelo y lo pasa a un formato en el que lo podamos graficar
def predecir_modelo(modelo, X_test_):
  predict = modelo.predict(X_test_)
  return sc.inverse_transform(predict)

