def search_optimus_prime(dic):
  optimum = {'mean_squared_error':[1, None], "root_mean_squared_error":[1, None], "mean_absolute_error": [1, None],"mean_squared_logarithmic_error":[1, None]}
  for combination in dic:
      if dic[combination][0] < optimum['mean_squared_error'][0]:
        optimum['mean_squared_error'] = [dic[combination][0], combination]
      if dic[combination][1] < optimum['root_mean_squared_error'][0]:
        optimum['root_mean_squared_error'] = [dic[combination][1], combination]
      if dic[combination][2] < optimum['mean_absolute_error'][0]:
        optimum['mean_absolute_error'] = [dic[combination][2], combination]
      if dic[combination][3] < optimum['mean_squared_logarithmic_error'][0]:
        optimum['mean_squared_logarithmic_error'] = [dic[combination][3], combination]
  return optimum


